class Numeric
  def percent_of(n)
    self.to_f / n.to_f * 100.0
  end
end

def redis_working?
  begin
    REDIS.get('test')
    true
  rescue
    false
  end
end

def set_products_count(product_count = nil)
  count = product_count || Product.count
  REDIS.set :products_count, count
  count
end

def get_products_count
  redis_working? && REDIS.get(:products_count) || Product.count
end

def reset_progress_count
  redis_working? && REDIS.set(:progress_count, 0)
end

def get_progress_count
  redis_working? && REDIS.get(:progress_count) || 0
end

def set_progress_count(product_index)
  products_count = get_products_count.to_i
  percent = product_index.percent_of(products_count.zero? ? set_products_count : products_count).round
  redis_working? && REDIS.set(:progress_count, percent)
end

def reset_notifications_log
  redis_working? && REDIS.set(:notifications_log, '')
end

def set_notifications_log(notifications_log)
  redis_working? && REDIS.set(:notifications_log, notifications_log)
end

def get_notifications_log
  redis_working? && REDIS.get(:notifications_log)
end

def get_products_compared_ids
  redis_working? && (REDIS.get(:products_compared_ids) || '').split(',')
end

def reset_products_compared_ids
  redis_working? && REDIS.set(:products_compared_ids, '')
end

def set_products_compared_ids(product_compared_id)
  products_compared_ids = get_products_compared_ids
  redis_working? && REDIS.set(:products_compared_ids, (products_compared_ids << product_compared_id).join(','))
end